import React from 'react';
import { Form } from 'react-router-dom';

const CreateEmployee = () => {
    return (
        <>
            <Form>
                <Form.Group> 
                    <Form.Label>FirstName</Form.Label>
                    <Form.Control type="text" />
                </Form.Group>
            </Form>
        </>
    );
};

export default CreateEmployee;
